import styles from './Menu.module.scss'

export default function Menu() {
  return (
    <header>
        <nav className={styles.nav}>
          <Link className={styles.link} href="/">Home</Link>
          <Link className={styles.link} href="/aboutme">About me</Link>
        </nav>
    </header>
  )
}
